import HeaderIT from "../components/HeaderIT";
import Container from 'react-bootstrap/Container';

function PasticceriaIT() {
    return (
        <>
            <HeaderIT />
            <section id='pasticceria'>
                <Container className='text-center d-flex flex-column justify-content-center'>
                    <h1>Le dolci creazioni di Enrico Parassina (Pastry Chef)</h1>
                    <iframe className="video" src='https://www.youtube.com/embed/jeHJd_22qUI?rel=0'></iframe>
                    <h2>La Pasticceria</h2>
                    <p>Al Ristorante Galleria troverete le dolci creazioni del Maestro Pasticciere (Exclusive Pastry Chef) <strong>Enrico Parassina</strong>, frutto di una lunga carriera intrapresa nei migliori alberghi e locali del mondo tra cui:</p>
                    <ul>
                        <li>Villa d'Este di Cernobbio</li>
                        <li>Kulm di Saint Moritz</li>
                        <li>Excelsior di Venezia</li>
                        <li>Harry's Bar di Londra</li>
                        <li>Four Seasons di Milano</li>
                    </ul>
                </Container>
            </section>
        </>
    );
}

export default PasticceriaIT;
